import React, { Component } from 'react'
import Navbar from "./Navbar";
import { MDBContainer, MDBRow, MDBCol, Banner } from "mdbreact";

export default class Home extends Component {
    render() {
        return (
            <div>
                <Navbar />

<Banner>
<MDBContainer>
 <MDBRow>
     <MDBCol md="6">
<div className="banner-title">
<h2><span class="is-display-block">We build great apps </span></h2>
<div className="typedbox">
<span class="with">with </span>

</div>
</div>

     </MDBCol>
     </MDBRow>   
</MDBContainer>

</Banner>

            </div>
        )
    }
}
